    return (
        <div style = {{
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            alignContent: 'center',
            alignItems: 'center'
        }}>
            <h1>Enter any number from 0-100</h1>
            <input type = "number">
            </input>
            <button style = {{
                backgroundColor: 'none',
                border: 'none',
                width: '200px'
            }} onClick = {(e) => e.target.value}>Click to Begin</button>
        </div>
    )
}
